import React from "react";
import "./HomePage.scss";
import VideoPlayer from "../../components/video-player/VideoPlayer";
import Main from "../../components/main/Main";

export default function HomePage({ video, heroVideo, changeVideo }) {
  return (
    <main>
      <VideoPlayer video={video} heroVideo={heroVideo} />
      <Main video={video} heroVideo={heroVideo} changeVideo={changeVideo} />
    </main>
  );
}
